import React from 'react';

function ServiceItem (props) {
    return (
        <div className="item">
            <img src={props.image} alt="image" />
            <h3>
                {props.title}
            </h3>
            <p>
                {props.description}
            </p>
        </div>
    );
}

export default ServiceItem;
